import React, { Component } from 'react';
//import '../css';

class CadUser extends Component{

    render() {
        return(
            <div >
                <label>
                    Nome:
                    <input type='text' name="inptNome"/>
                </label>
                <br/>
                <label>
                    Email:
                    <input type='text' name="inptEmail"/>
                </label>
                <input type="submit" value="Submit" />
            </div>
        );
    }
};

export default CadUser;
